INSERT INTO `lang_definitions` VALUES (11375, 3995, 5, 'Bij het zoeken wordt u een lijst van facturen getoond. U klikt op een van de factuurnummers om een tweede venster te openen, waarbij gegevensinvoer in de pagina handmatig gedaan kan worden. U kunt ook klikken op de naam van een patint als u een notitie wilt maken voor de front office medewerkers, zodat deze kunnen zien wanneer de patint aankomt en u kunt de facturen selecteren die op de statements van de patint verschijnen en deze statements afdrukken.');
